import { Add, Remove } from "@mui/icons-material";
import styled from "styled-components";
import Announce from "../components/Announce";
import Footer from "../components/Footer";
import Navbar from "../components/Navbar";
import Newsletter from "../components/Newsletter";
import {mobile} from "../components/Responsive"

const Container= styled.div`

`
const Wrapper= styled.div`
padding:50px;
display:flex;
${mobile({flexDirection: "column", padding:"10px"})}

`
const ImgContainer= styled.div`
flex:1;
`
const InfoContainer= styled.div`
flex:1;
padding: 0px 50px;
`
const Image= styled.img`
width:100%;
height:90vh;
object-fit:cover;
${mobile({height: "50vh", margin:"0px"})}

`
const Title=styled.h1`
font-weight:300;
`

const Desc=styled.p`
margin:20px 0px;
`
const Price=styled.span`
font-weight:100;
font-size:40px;
`
const FilterContainer=styled.div`
width:50%; 
margin:20px;
display:flex;
justify-content:space-around;
`
const FilterTitle=styled.h4`

`
const Filter=styled.div`

display:flex;
align-items:center;
`
const FilterColor=styled.option`
width:20px;
height:23px;
border-radius:50%;
background-color:${props=>props.color};
margin:0px 5px;
cursor:pointer;

`
const FilterSize=styled.select`
padding:5px;
margin:5px;
`
const FilterSizeOption=styled.option`
`

const AddContainer=styled.div`
display:flex;
align-items:center;
width:50%;
justify-content:space-between;
`

const AmountContainer=styled.div`
display:flex;
align-items:center;
${mobile({justifyContent: "center"})}

`
const Amount=styled.span`
width:30px;
height:30px;
border-radius:10px;
border: 1px solid teal;
margin:10px;
display:flex;
align-items:center;
justify-content:center;
`
const Button=styled.button`
background-color: black;
border:none;
color:white;
padding:15px;
cursor: pointer;
transition:0.3s ease;
&:hover{
    opacity:0.9;
    transform:scale(1.1);
    }
`
const Product = () => {
    return (
        <Container>
        <Announce/>
             <Navbar/>


<Wrapper>


    <ImgContainer>
    <Image src="https://www.prada.com/content/dam/pradanux_products/U/UCS/UCS319/1YOTF010O/UCS319_1YOT_F010O_S_182_SLF.png"/>
    </ImgContainer>

    <InfoContainer>
         <Title>Prada Sweater</Title>
         <Desc>Lorem ipsum dolor sit amet consectetur adipisicing elit. Odio animi cumque impedit, veritatis voluptate assumenda id optio! Consequuntur, eveniet totam.</Desc>
         <Price>$65</Price>
         <FilterContainer>
             <Filter>
<FilterTitle>Color</FilterTitle>
<FilterColor color="black" /> 
<FilterColor color="darkblue" /> 
<FilterColor color="gray" /> 

             </Filter>

             <Filter>

<FilterTitle>Size</FilterTitle>
<FilterSize>
    <FilterSizeOption>S</FilterSizeOption>
    <FilterSizeOption>M</FilterSizeOption>
    <FilterSizeOption>L</FilterSizeOption>
    <FilterSizeOption>XL</FilterSizeOption>
    <FilterSizeOption>XXL</FilterSizeOption>
    </FilterSize>

             </Filter>

         </FilterContainer>
         <AddContainer>
             <AmountContainer>
                <Remove/>
                <Amount>1</Amount>
                <Add/>
             </AmountContainer>
             <Button>ADD TO CART</Button>



         </AddContainer>



    </InfoContainer>
    </Wrapper>



        <Newsletter/>
        <Footer/>
         </Container>
    )
}

export default Product
